&lt;p&gt;
	I agree with the inspection results but have since carried out the following improvements. The establishment has been thoroughly cleaned and procedures are in place to ensure cleanliness is maintained, A new management system has been implemented. The staff have been re-trained/given instruction are under revised supervision&lt;/p&gt;
&lt;p&gt;
	Getting a 1* rating was a shocking wake-up call. We have always been proud of our 5* rating and care deeply about our customers and the quality of food and service we provide. As a courtesy to our customers I feel obligated to explain how this came about and what we have done to correct the issues raised.&lt;/p&gt;
&lt;p&gt;
	1 The Food safety management documentation was not on the premises (taken home for revision) at the time of the visit. This documentation is now in place in hard copy and digital so that situation can not arise again.2. Although we have received 5* ratings in the past and we had separate staff hand-washing facilities, we were scored down for inadequate hand-washing facilities. This has also been rectified with the addition of a second staff hand washing facility. 3. There was an omission on our allergen chart in spite of only being revised 3 months prior. Genuine error now rectified and the whole chart gone through with meticulous care. If you want to know about any allergens in our food we can confidently give the correct information. Just ask. With all the works carried out and ongoing staff training I feel confident we are well on track towards a 5* rating again. Thank you for taking the time to read.&lt;/p&gt;
